import React from "react";

import AppLayout from "../components/AppLayout";
import Head from "next/head";

const Profile = () => (
  <>
    <Head>
      <meta charSet="utf-8" />
      <title>NodeBird</title>
    </Head>

    <AppLayout>
      <div>내 프로필</div>
    </AppLayout>
  </>
);

export default Profile;
